INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(1, 'Die 3 gr√∂ssten Hardware-Flops von 2024 noch einmal auf den Besuch', , '<h3>\r\nDas gehypte Rabbit R1, Humane Ai Pin und Apple Vision Pro haben seit ihren glanzlosen Markteinf√ºhrungen weiterhin Updates erhalten. Wie l√§uft es? Ich habe sie noch einmal ausprobiert, um es herauszufinden.\r\n</h3>\r\n<br>\r\n<p>\r\nDas Jahr begann mit einem solchen Versprechen. Ich erinnere mich, dass ich im Januar w√§hrend der CES 2024 in einem Pr√§sentationsraum in einem Hotel in Las Vegas sa√ü, als Jesse Lyu, CEO von Rabbit, den R1 enth√ºllte. Dieser farbenfrohe und lustige KI-Begleiter im Taschenformat versprach, alles zu tun, von der Bestellung eines Uber bis hin zur Beantwortung all Ihrer √§rgerlichen Fragen. Meine Geschichte‚ÄØauf dem R1 war gerade live gegangen‚ÄØund innerhalb weniger Stunden - ich versuche hier nicht, mir auf die Schulter zu klopfen - gab es‚ÄØviele‚ÄØAug√§pfel darauf. Das Ger√§t war anders als alles, was zuvor gekommen war, und zeigte uns eine neue Vision davon, wie diese neuartigen KI-Agenten in unser Leben passen w√ºrden. Rabbits R1 wurde zur Durchbruchsgeschichte von CES, und das Unternehmen behauptet, dass es bis M√§rz 100.000 Einheiten verkauft hat.\r\n<br> \r\n<img src=\"../assets/embed/Image (3).jpeg\">\r\n<br>\r\n<p>\r\nBald darauf kam‚ÄØApples Vision Pro auf den Markt‚ÄØ‚Äì ein Mixed-Reality-Headset f√ºr 3.499 US-Dollar, mit dem Sie der realen Welt entfliehen k√∂nnen, um Filme zu schauen, Spiele zu spielen und in einem Cyber-B√ºro mit mehreren Bildschirmen zu arbeiten, die um Sie herum bewegen. Apple hatte das‚ÄØJahr zuvor‚ÄØdamit verbracht, es zu √ºbertreiben, und es war die erste neue Produktkategorie f√ºr das Unternehmen seit der Apple Watch im Jahr 2015.\r\n<br>\r\nEin paar Monate sp√§ter‚ÄØkam Humanes Ai Pin an. Wie der Hase war dies ein weiterer KI-Assistent, obwohl er f√ºr den Revers gedacht war. Ich besuchte meine Mutter kurz vor der Einf√ºhrung des Ai Pin, und aus heiterem Himmel fragte sie mich, ob ich von diesem \"Pin\"-Produkt geh√∂rt h√§tte, weil sie auf einem indischen Nachrichtensender davon geh√∂rt hatte. Es war nicht nur das‚ÄØGerede der Stadt, sondern das Gerede der Welt.\r\n<br>\r\nDiese drei spektakul√§r gehypten Produkte haben eines gemeinsam: Sie sind alle floppt. Ai Pin von Humane funktionierte kaum und wurde bei der Ver√∂ffentlichung von Kritikern weithin kritisiert. Kurze Zeit sp√§ter wurden mehr Ai Pins zur√ºckgegeben als gekauft. (Soll ich erw√§hnen, dass der Ladefall ein Brandschutzrisiko darstellt?) Das Unternehmen m√∂chte nun sein CosmOS-Betriebssystem an Dritte lizenzieren, um in Autos und intelligente Lautsprecher eingeschleust zu werden, obwohl diese Strategie keine Produktintegrationen daf√ºr hat.\r\n<br>\r\nIch bin mir sicher, dass ich den Vision Pro wieder verwenden werde, aber es wird wahrscheinlich lange Zeitabschnitte zwischen den Sitzungen sehen, wenn ich ihn zur√ºckschiebe, um ein Video anzusehen oder einen Videochat zu f√ºhren. Der R1 und der Humane Ai Pin werden in ihre jeweiligen Boxen zur√ºckkehren. Ich werde bereit sein, sie wieder zu feuern, wenn ein gro√ües Update mit neuen Funktionen zum Testen landet. Oder vielleicht ist es die M√ºhe einfach nicht wert.\r\n</p>', 'Tobias Wechsler', '2025-01-15 14:22:08', 'Hardware', 'must-read');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(3, '1-Minuten-Check f√ºr die FritzBox: Integrierte Schnellfunktion pr√ºft Ihren WLAN-Router', , '<h3>\r\nWenn die FritzBox nicht l√§uft, kommt zuhause Stress auf. Doch es gibt eine recht einfache Methode, die grundlegende Funktionsweise zu pr√ºfen. In unter einer Minute wissen Sie, was bei Ihrem WLAN-Router Sache ist\r\n</h3>\r\n<br>\r\n<p>\r\nMeist wird man erst aktiv, wenn es ein Problem mit der FritzBox gibt, etwa wenn die Internet-Verbindung nicht mehr klappt, das WLAN lahmt oder man telefonisch nicht mehr erreichbar ist. Doch auch wenn Ihre FritzBox schnurrt wie ein K√§tzchen, kann ein Funktions-Check n√ºtzlich sein. Sie k√∂nnen damit n√§mlich ganz einfach feststellen, ob wirklich alles richtig funktioniert. \r\n<br>\r\nEin Zusatz-Tool ist daf√ºr nicht n√∂tig, Sie k√∂nnen f√ºr einen Schnell-Check der FritzBox eine eingebaute Funktion verwenden. Die pr√ºft Internetanbindung, Funkverbindungen, Anschlussbelegungen und Ihr Heimnetz insgesamt. Der Funktions-Check l√§sst sich auch √ºber die‚ÄØMyFritzApp‚ÄØanwerfen. \r\n<br>\r\nSpezielle Kenntnisse sind f√ºr den FritzBox-Funktions-Check nicht n√∂tig. Sie steuern einfach auf der FritzBox-Oberfl√§che den Punkt \"Diagnose\" an und w√§hlen darunter \"Funktion\". Dann gibt es einen Button mit der Aufschrift \"Starten\". Einmal klicken wirft den Funktionstest an, der in wenigen Sekunden durchl√§uft. \r\n<br>\r\nDas wird alles gepr√ºft: \r\n</p>\r\n<br>\r\n<img src=\"../assets/embed/Image (2).jpeg\">\r\n<br>\r\n<p>\r\n-Aktuelles FritzOS \r\n<br>\r\n-Benutzername und Kennwort vergeben \r\n<br>\r\n-Belegung der LAN-Ports \r\n<br>\r\n-WLAN-Konfiguration \r\n<br>\r\n-WLAN-Kanalbelegung \r\n<br>\r\n-DECT-Status \r\n<br>\r\n-Internetverbindung \r\n<br>\r\n-Aktive Rufnummern \r\n<br>\r\n-Mesh-Status \r\n<br>\r\n-Anzahl der Ger√§te im Heimnetz\r\n<br>\r\n<br>\r\nIm Optimalfall finden Sie bei allen gepr√ºften Eintr√§gen ein gr√ºnes H√§kchen. Dann l√§uft Ihre FritzBox so, wie sie soll. Der Report gibt aber auch Hinweise, etwa, wenn die telefonische Erreichbarkeit eingeschr√§nkt ist, liefert zus√§tzliche Infos, zum Beispiel √ºber abgeschaltete Bereiche und meldet Fehler, wenn etwa eine unterbrochene Internet-Verbindung festgestellt wird. \r\n<br>\r\nDas Ergebnis eines Funktionstests k√∂nnen Sie als CSV-Datei abspeichern und so zum Beispiel bei Problemen f√ºr den AVM-Support nutzen. Die Funktionspr√ºfung kann also ein wichtiger Ausgangspunkt f√ºr Probleml√∂sungen sein.\r\n</p>', 'Lukas Meier', '2025-03-03 08:11:47', 'Hardware', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(5, 'Samsung bringt neues Update: Wichtige App wird mit One UI 7 weiter verbessert', , '<h3>\r\nMit dem Update auf One UI 7 verbessert Samsung eine wichtige App. Nutzer k√∂nnen jetzt ein Modul in der Anwendung noch besser ihrem Geschmack anpassen.\r\n</h3>\r\n<br>\r\n<p>\r\nSamsung‚ÄØhat das ClockFace-Modul f√ºr Good Lock aktualisiert. Die neue Version 3.3.07.0 bringt die Kompatibilit√§t mit‚ÄØOne UI‚ÄØ7 auf‚ÄØAndroid‚ÄØ15. Diese Neuerung soll es Nutzern erm√∂glichen, ihre Uhrenanzeige auf dem Sperrbildschirm einfacher zu personalisieren und dabei aus einer Vielzahl von Designs und Stilen zu w√§hlen. \r\n<br>\r\nDas Update integriert den LockScreen-Editor, der eine intuitive und schnelle Anpassung der Designs direkt im Sperrbildschirm erlaubt. Nutzer k√∂nnen verschiedene Stile, Farben und Animationen ausw√§hlen, um ihre Sperrbildschirm-Uhr zu gestalten. Dies ist auf dem Screenshot von ‚ÄûSam Lover‚Äú zu sehen. \r\n<br>\r\nSamsung-Nutzer k√∂nnen das ClockFace-Modul in Good Lock jetzt besser personalisieren. Samsung r√ºstet dadurch alle Module des Good Lock-√ñkosystems schrittweise f√ºr One UI 7, um ein nahtloses Nutzererlebnis zu schaffen. Die neue Uhrzeitgestaltung kann auch mit LockStar zu kombiniert werden, wodurch sich Widgets, Benachrichtigungen und Shortcuts auf dem Sperrbildschirm platzieren lassen. Das Update steht im Galaxy Store zum Download bereit. \r\n<br>\r\nAuch Google hat ein neues Update f√ºr Android ausgerollt. Eine Akku-Funktion sollte nicht ignoriert werden.</p>', 'Dominik Stalder', '2025-03-05 21:56:34', 'Hardware', 'trending');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(7, 'Drucken ohne Patronenstress: Epson EcoTank ‚Äì Amazon-Deal im Check ', , '<h3>\r\nDer Epson EcoTank ET-2870 A4 macht den st√§ndigen Patronenwechsel √ºberfl√ºssig und spart bis zu 90% bei den Tintenkosten ‚Äì aktuell als g√ºnstigste Variante bei Amazon erh√§ltlich\r\n<br>\r\n</h3>\r\n<p>\r\nKompakter All-in-One-Drucker mit nachf√ºllbaren Tintentanks:\r\n<br>\r\nDer‚ÄØEpson EcoTank ET-2870‚ÄØist ein A4-Multifunktionsdrucker, der Drucken, Scannen und Kopieren in einem Ger√§t vereint. Dank nachf√ºllbarer Tintentanks erm√∂glicht er kosteng√ºnstiges und umweltfreundliches Drucken, ohne auf teure Tintenpatronen angewiesen zu sein. Bei Amazon gibt\'s dieses Modell nun f√ºr‚ÄØ170,99 Euro‚ÄØ‚Äì eine Ersparnis von 37 Prozent im Vergleich zum UVP. Patronenlos drucken ‚Äì So funktioniert\"s \r\n<br>\r\nWer h√§ufig druckt, kennt das Problem: St√§ndig neue Patronen kaufen und einwechseln. Mit dem‚ÄØEcoTank ET-2870‚ÄØgeh√∂ren diese Umst√§nde der Vergangenheit an. Dank der gro√üz√ºgigen Tintentanks wird das Nachf√ºllen zum Kinderspiel und ein einzelner Tintenflaschensatz erm√∂glicht den Druck von bis zu 4.500 Seiten in Schwarz-Wei√ü sowie 7.500 Seiten in Farbe. Das entspricht in etwa 72 herk√∂mmlichen Tintenpatronen ‚Äì und reicht f√ºr bis zu drei Jahre Druckvergn√ºgen. \r\n<br>\r\nTechnische Details: \r\n<br>\r\n-Drucktechnologie: Tintenstrahl \r\n<br>\r\n-Funktionen: Drucken, Scannen, Kopieren \r\n<br>\r\n-Konnektivit√§t: Wi-Fi, USB \r\n<br>\r\n-Papierformate: A4, A5, A6, B5, C6 (Umschl√§ge), DL (Umschl√§ge) \r\n<br>\r\n-Display: LCD \r\n<br>\r\n-Kabelloses Drucken f√ºr flexibles Arbeiten \r\n<br>\r\nDank WLAN-Funktion l√§sst sich der Drucker einfach ins Heim- oder B√ºronetzwerk einbinden, sodass kabelloses Drucken von verschiedenen Ger√§ten m√∂glich ist. Das Modell eignet sich besonders f√ºr Home-Office und kleine B√ºros, die Wert auf niedrige Druckkosten und Nachhaltigkeit legen. \r\n<br>\r\n</p>\r\n<h3>\r\nUnsere Einsch√§tzung\r\n<br>\r\n</h3>\r\n<p>\r\nDer Epson EcoTank ET-2876 punktet mit niedrigen Druckkosten dank nachf√ºllbarer Tintentanks und bietet eine einfache Handhabung f√ºr den Alltag im Home-Office oder kleinen B√ºros. Besonders die WLAN-Konnektivit√§t macht das Modell flexibel einsetzbar. Wer einen kosteneffizienten und umweltfreundlichen Drucker sucht, d√ºrfte hier f√ºndig werden.\r\n<br>\r\n</p>\r\n<h3>\r\nDie besten Multifunktionsdrucker\r\n<br>\r\n</h3>\r\n<p>\r\nManchmal l√§sst es sich trotz zunehmender Digitalisierung im B√ºro nicht vermeiden, eine E-Mail oder ein Dokument auf Papier zu fixieren. Damit sie daf√ºr aber nicht regelm√§√üig den Copy-Shop nutzen m√ºssen, ist ein eigener Drucker eine der ersten Anschaffungen f√ºr das heimische B√ºro. Allerdings gibt es selbst beim Kauf eines Multifunktionsdruckers einige Aspekte zu beachten: Tintenstrahl- oder Laserdruck? Duplex oder nicht Duplex? Hohe Druckgeschwindigkeiten oder bester Fotodruck?\r\n<br>\r\nIn unserer‚ÄØCHIP-Kaufberatung zum Thema Multifunktionsdrucker‚ÄØpr√§sentieren wir nicht nur die besten getesteten Drucker unter den Tintenstrahlern und Laserdruckern, sondern auch die jeweiligen Preistipps. Au√üerdem liefern wir Ihnen Infos zu den verschiedenen Drucker-Arten, die Ihnen die Kaufentscheidung erleichtern sollten.\r\n</p>', 'Elio Fritschi', '2025-02-19 12:09:23', 'Hardware', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(8, 'Heller, sch√§rfer, intensiver: Sony-Fernseher werden dreifarbig', , '<h3>\r\nSony hat eine neue Hintergrundbeleuchtung mit dreifarbigen Mini-LEDs entwickelt. Der japanische TV-Hersteller verspricht sich davon f√ºr seine Displays noch mehr Helligkeit, pr√§zisere Farben und sch√§rfere Kontraste.\r\n<br>\r\n</h3>\r\n<p>\r\nTV-Spezialist Sony stellt dieser Tage eine neue Hintergrundbeleuchtung mit Mini-RGB-Leuchtdioden vor, bei denen die Grundfarben einzeln ansteuerbar sind. Gegen√ºber einer konventionellen Hintergrundbeleuchtung aus blauen Mini-LEDs in Kombination mit einer Quantum-Dot-Schicht sollen sich dadurch gleich mehrere Vorteile ergeben. Die separaten Farbspitzen der RGB-LEDs sollen pr√§ziser sein und vor allem √ºber den gesamten Helligkeitsbereich stabil bleiben. Durch den Wegfall der QD-Schicht entsteht weniger Streulicht, was der Spitzenhelligkeit, den Kontrasten und auch der Bildqualit√§t bei seitlichen Blickwinkeln zugutekommt. \r\n<br>\r\nLaut den Sony-Entwicklern sind bei Displays mit ihrem Mini-RGB-Backlight Spitzenhelligkeiten von √ºber 4.000 cd/m¬≤ m√∂glich. Der f√ºr HDR-Bilder entscheidende DCI-P3-Farbraum soll damit zu 99 Prozent und der weitergefasste ITU-R-BT.2020-Farbraum sogar schon zu 90 Prozent abgedeckt werden. Zum Vergleich: Der beste LCD-Fernseher in unserer aktuellen Bestenliste kommt auf knapp 3.000 cd/m¬≤, der beste QD-OLED-Schirm auf 89 Prozent BT.2020-Abdeckung. Da jede Grundfarbe separat mit 22 Bit ansteuerbar ist, ergibt sich daraus auch eine dreifach h√∂here Farbaufl√∂sung. Womit Sony nicht nur die gleichzeitige Darstellung von tiefem Schwarz und strahlendem Wei√ü, sondern auch die detaillierte Darstellung von hellen und dunklen Bereichen in Szenen mit vielen Farbschattierungen besser gelingen soll. √úber die Anzahl der Dimmingzonen mochte uns Sony aber keine Auskunft geben. \r\n<br>\r\nIm direkten Vergleich eines Bildschirms mit Mini-LED-Backlight und einem Prototypen mit Mini-RGB-Lichtern waren die Vorteile von Mini-RGB auch deutlich zu sehen ‚Äî zumindest mit den Demo-Bildern des Herstellers. Szenen mit grellem Sonnenlicht und viel dunklem Schatten wurden detaillierter aufgel√∂st. Die Farben verblassten im Hellen nicht und vor allem Gr√ºn- sowie Hautt√∂ne wirkten nat√ºrlicher. Auch von der Seite betrachtet wurden Farben und Kontraste mit Mini-RGBs eindeutig intensiver und sch√§rfer dargestellt. \r\n<br>\r\n√úber konkrete Modelle mit RGB-Hintergrundbeleuchtung schweigt sich Sony bis dato noch aus. W√§hrend der Vorf√ºhrung sprachen die Entwickler sibyllinisch nur von einer \"Technik f√ºr 2026\". Unserer Erfahrung nach werden wir vermutlich aber schon auf der IFA im September wenigstens Prototypen sehen. Und w√§hrend der CES 2026 in Las Vegas vielleicht schon die ersten Serienger√§te in der Premiumklasse.\r\n</p>', 'Philipp G√∂tz', '2025-01-29 16:45:11', 'Hardware', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(10, 'Sonos stoppt Entwicklung: Es kommt nun doch kein Apple TV-Klon', , '<h3>\r\nSonos hat √ºberraschend seine Pl√§ne f√ºr einen eigenen Streaming-Video-Player aufgegeben.\r\n</h3>\r\n<br>\r\n<p>\r\nDas Ger√§t, intern als \"Pinewood\" bezeichnet, sollte urspr√ºnglich im Jahr 2025 auf den Markt kommen. Es befand sich bereits in fortgeschrittenem Entwicklungsstadium. \r\n<br>\r\nWie The Verge nun meldet, hat Interims-CEO Tom Conrad das Projekt, das starke √Ñhnlichkeiten mit der Apple TV Box zeigte, w√§hrend einer internen Besprechung offiziell eingestellt. \r\n<br>\r\nDiese Entscheidung bedeutet zugleich, dass Sonos in der zweiten Jahresh√§lfte kein bedeutendes neues Produkt lancieren wird. Zuletzt brachte das Unternehmen die Arc Ultra Soundbar und den Sub 4 heraus. \r\n<br>\r\nEinige Mitarbeiter √§u√üerten zuvor bereits die Sorge, dass Pinewood das gleiche Schicksal wie die Sonos Ace Kopfh√∂rer erleiden k√∂nnte ‚Äì ein schwerer Einstieg in ein Marktsegment, das von Roku, Amazon, Apple und Google beherrscht wird. \r\n<br>\r\nStattdessen richtet Sonos nun seinen Fokus auf die Verbesserung seiner Software und App-Leistung, um das Unternehmen nach einem herausfordernden Jahr 2024 wieder auf Erfolgskurs zu bringen. \r\n<br>\r\nDie Streaming-Box sollte urspr√ºnglich √ºber HDMI-Switching und Gaming-Passthrough verf√ºgen, doch diese Pl√§ne wurden vorerst auf Eis gelegt. Ob Sonos langfristig dennoch einen Vorstoss in den Streaming-Hardware-Markt wagen wird, bleibt momentan unklar. Diese Entscheidung folgt einer Reihe von schlechten Nachrichten in den letzten Monaten, darunter ein App-Debakel, Ver√§nderungen in der F√ºhrungsetage und umfangreiche Entlassungen.\r\n</p>', 'Kieran Holt', '2025-03-17 23:02:57', 'Hardware', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(12, 'TPM 2.0 nachr√ºsten: So machen Sie Ihren PC fit f√ºr Windows 11', , '<h3>\r\nDas Nachr√ºsten von TPM 2.0 kann die Sicherheit Ihres PCs erheblich steigern und ist f√ºr Windows 11 sogar erforderlich. Wir zeigen Ihnen, wie Sie das Trusted Platform Module 2.0 auf Ihrem Computer installieren und worauf Sie dabei achten m√ºssen.\r\n</h3>\r\n<br>\r\n<p>\r\nWarum ist das Nachr√ºsten von TPM 2.0 notwendig? \r\n<br>\r\nM√∂chten Sie‚ÄØWindows 11‚ÄØauf Ihrem Computer installieren, m√ºssen die‚ÄØVoraussetzungen des Betriebssystems‚ÄØerf√ºllt sein. Eine der Voraussetzungen ist, dass Ihr Computer √ºber ein Trusted Platform Module (TPM) 2.0 verf√ºgt.‚ÄØ \r\n<br>\r\nWindows 11 erfordert dies als grundlegende Sicherheitskomponente zur Verschl√ºsselung sensibler Daten und zum Schutz vor unbefugtem Zugriff.‚ÄØ \r\n<br>\r\nDabei handelt es sich um einen speziellen Chip auf Ihrem‚ÄØMainboard, der kryptografische Schl√ºssel sicher speichern kann. Dies sorgt daf√ºr, dass Ihre Daten selbst bei physischem Zugriff auf den Computer gesch√ºtzt bleiben. \r\n<br>\r\nNeben der Verschl√ºsselung spielt das TPM auch eine Rolle bei der Integrit√§ts√ºberpr√ºfung Ihres Systems. Es stellt sicher, dass keine unerlaubten √Ñnderungen an der Software oder Hardware vorgenommen wurden, was besonders f√ºr Unternehmen von Bedeutung ist.\r\n</p>\r\n<br>\r\n<h3>\r\nVerf√ºgt Ihr PC bereits √ºber TPM 2.0?\r\n</h3>\r\n<br>\r\n<p>\r\nBevor Sie ein Modul zum Nachr√ºsten kaufen, sollten Sie √ºberpr√ºfen, ob Ihr aktuelles System bereits √ºber TPM 2.0 verf√ºgt.‚ÄØ \r\n<br>\r\n√ñffnen Sie hierf√ºr die Windows-Sicherheit √ºber das Startmen√º und klicken Sie im Reiter links auf \"Ger√§tesicherheit\". Hier finden Sie unter \"Details zum Sicherheitschip\" Informationen dar√ºber, ob TPM auf Ihrem Ger√§t aktiviert ist und welche Version installiert ist. \r\n<br>\r\nIst das TPM-Modul deaktiviert, m√ºssen Sie dieses‚ÄØaktivieren. Das ist √ºber das‚ÄØBIOS‚ÄØIhres Computers m√∂glich. Im Abschnitt \"Sicherheit\" sollten Sie hier das TPM-Modul aktivieren k√∂nnen. \r\n<br>\r\nWenn kein TPM-Chip vorhanden ist oder nur eine √§ltere Version angezeigt wird, sollten Sie √ºberlegen, wie Sie den Chip nachr√ºsten k√∂nnen. Dazu gibt es verschiedene Optionen, je nachdem, welchen Computer und welches Motherboard Sie verwenden. \r\n<br>\r\nViele moderne Laptops und Desktops haben mittlerweile TPM 2.0 integriert, jedoch k√∂nnte es deaktiviert sein. Ein einfaches Aktivieren im BIOS/UEFI kann oft schon ausreichen, um Windows 11-kompatibel zu werden.\r\n</p> \r\n<br>\r\n<h3>\r\nSo r√ºsten Sie TPM 2.0 nach\r\n</h3>\r\n<br>\r\n<p>\r\nSollte Ihr PC nicht √ºber TPM 2.0 verf√ºgen, k√∂nnen Sie dieses nachr√ºsten. F√ºr Desktop-PCs bieten viele Mainboard-Hersteller‚ÄØTPM-Module‚ÄØan, die sich einfach installieren lassen. Diese Module werden direkt auf einen speziellen Steckplatz auf dem Motherboard gesteckt und sind dann sofort einsatzbereit. \r\n<br>\r\nBeachten Sie jedoch, dass TPM-Module nicht universell kompatibel sind. Vor dem Kauf sollten Sie darauf achten, dass der Chip zu Ihrem Motherboard passt. Eine weitere M√∂glichkeit besteht darin, ein neues Motherboard zu erwerben, das TPM 2.0 unterst√ºtzt. Dies kann sich insbesondere dann lohnen, wenn Ihr aktuelles System bereits √§lter ist und ohnehin ein Upgrade ben√∂tigt. \r\n<br>\r\nBei Laptops gestaltet sich die Nachr√ºstung etwas schwieriger, da diese meist auf Module verzichten. Hier bleibt oft nur die Option, ein neues Ger√§t zu erwerben, das den neuen Standards entspricht.\r\n</p>\r\n<br>\r\n<h3>\r\nNachr√ºstung abgeschlossen: Trusted Plattform Module richtig einrichten\r\n</h3>\r\n<br>\r\n<p>\r\nNachdem Sie TPM 2.0 erfolgreich nachger√ºstet haben, sollten Sie sicherstellen, dass es korrekt eingerichtet ist. \r\n<br>\r\nStarten Sie Ihren PC neu und rufen Sie das BIOS-Men√º auf, um sicherzustellen, dass TPM 2.0 aktiviert ist. M√∂glicherweise m√ºssen Sie dieses unter \"Sicherheit\" aktivieren. \r\n<br>\r\nSobald TPM 2.0 aktiviert ist, k√∂nnen Sie in den Windows-Einstellungen √ºberpr√ºfen, ob Ihr System nun alle Anforderungen f√ºr Windows 11 erf√ºllt. Ist das der Fall, k√∂nnen Sie das‚ÄØUpdate auf Windows 11‚ÄØdurchf√ºhren. \r\n<br>\r\nNutzen Sie die Gelegenheit, um auch andere Sicherheitsfeatures zu aktivieren. Sie k√∂nnen zum Beispiel BitLocker nutzen, um Ihre‚ÄØFestplatte zu verschl√ºsseln.\r\n</p>', 'Andreas Benz', '2025-02-28 07:33:49', 'Software', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(14, 'KI-Bilder erstellen: Diese M√∂glichkeiten gibt es', , '<h3>\r\nWer mit einer KI Bilder erstellen will, findet im Web mittlerweile viele Optionen. Je nach Anforderung stehen Ihnen verschiedene KI-Generatoren zur Verf√ºgung.\r\n</h3>\r\n<br>\r\n<p>\r\nK√ºnstliche Intelligenz‚ÄØist in aller Munde. Falls Sie erstmal ausprobieren m√∂chten, welche M√∂glichkeiten es gibt, mit einer‚ÄØKI Bilder zu erstellen, dann gibt es daf√ºr zahlreiche kostenfreie Anwendungen. Bei vielen Tools kann eine bestimmte Anzahl an Bildern kostenfrei erstellt werden, damit Sie sich ein Bild von der jeweiligen Anwendung machen k√∂nnen. \r\n<br>\r\nCraiyon‚ÄØist ein Werkzeug, mit dem Sie Ihre Fantasie zum Leben erwecken und beeindruckende Kunstwerke erschaffen k√∂nnen. Der AI Image Generator ist komplett kostenlos und Sie k√∂nnen bis zu 9 Bilder innerhalb einer Minute generieren lassen. \r\n<br>\r\nPlayground AI‚ÄØbietet die kostenlose Erstellung von 50 Bildern pro Tag, die sogar kommerziell genutzt werden d√ºrfen. Erweiterte Funktionen, wie beispielsweise eine schnellere Bilderstellung und das Generieren von mehr Bildern, sind kostenpflichtig. Das Tool‚ÄØDreamlike‚ÄØist in einer limitierten Version ebenfalls kostenfrei nutzbar. 24 Credits pro Tag sind in der kostenlosen Version enthalten. Nach der Anmeldung werden 50 Credits gutgeschrieben. \r\n<br>\r\n√úber den‚ÄØBing Image Creator‚ÄØvon Microsoft k√∂nnen Sie unbegrenzt kostenlos Bilder erstellen lassen. Zus√§tzlich erhalten Sie eine gewisse Anzahl an Boosts, mit denen Sie die Bilder noch schneller erstellen lassen k√∂nnen. \r\n</p> \r\n<br>\r\n<img src=\"../assets/embed/Image (9).jpeg\">\r\n<br>\r\n<p>\r\nDie beschriebenen‚ÄØkostenfreien Anwendungen‚ÄØsind meist in einer kostenpflichtigen Variante mit mehr Einstellungsm√∂glichkeiten und Funktionen erh√§ltlich. Doch es gibt auch einige Tools, die ausschlie√ülich kostenpflichtig genutzt werden k√∂nnen, daf√ºr aber auch bessere Ergebnisse versprechen. \r\n<br>\r\nMidjourney‚ÄØkostet zwischen 10 und 120 Dollar pro Monat, je nach gew√§hltem Abo. Zudem k√∂nnen Sie verschiedene Add-Ons hinzubuchen. Das Tool verspricht daf√ºr hochqualitative Ergebnisse. \r\n<br>\r\nDALL-E‚ÄØ3 ist ein weiteres kostenpflichtiges Programm und erfolgt √ºber ein Kredit-System. Sie erhalten eine bestimmte Anzahl an Credits beim Anmelden und k√∂nnen weitere Credits erwerben, wenn Sie Ihr Kontingent aufgebraucht haben. Die genauen Preise k√∂nnen variieren und h√§ngen von der Anzahl der gew√ºnschten Credits ab. \r\n<br>\r\nArtSmart‚ÄØist ein weiterer KI-Bildgenerator, der zwischen 16 und 32,50 Dollar pro Monat kostet. Der Generator ben√∂tigt nur wenig Zeit zum Erstellen neuer Bilder und stellt dar√ºber hinaus qualitativ sehr hochwertige Ergebnisse zur Verf√ºgung.\r\n</p>\r\n<br> \r\n<h3>\r\nKI-Bilder erstellen: So geht es mit ChatGPT\r\n</h3>\r\n<br>\r\n<p>\r\nUm mit‚ÄØChatGPT‚ÄØKI-Bilder zu erstellen, k√∂nnen Sie die Integration von DALL-E nutzen, einer KI-Bildgenerierungstechnologie, die von OpenAI entwickelt wurde. Hier ist eine einfache Anleitung, wie Sie mit ChatGPT KI-Bilder erstellen k√∂nnen: \r\n<br>\r\nKlar definierte Bildbeschreibung:‚ÄØGeben Sie eine detaillierte Beschreibung des Bildes ein, das Sie erstellen m√∂chten. Je pr√§ziser und detaillierter die Beschreibung, desto genauer wird das Bild. \r\n<br>\r\nAnweisungen f√ºr den Stil und das Format:‚ÄØFalls gew√ºnscht, k√∂nnen Sie auch den Stil des Bildes, die Farbpalette, die Perspektive oder andere k√ºnstlerische Details angeben. \r\n<br>\r\nBildgenerierung:‚ÄØNachdem Sie die Beschreibung eingereicht haben, wird‚ÄØChatGPT‚ÄØdas Bild mit der DALL-E-Technologie erstellen. \r\n<br>\r\nVermeidung von Urheberrechtsverletzungen:‚ÄØVermeiden Sie es, nach Bildern zu fragen, die direkt auf gesch√ºtzten Inhalten oder aktuellen K√ºnstlern basieren. \r\n<br>\r\nPrivatpersonen:‚ÄØBei der Erstellung von Bildern von bestimmten Personen m√ºssen Beschreibungen verwendet werden, anstatt direkte Namen zu verwenden.\r\n</p>', 'Jakob Hetsel', '2025-03-11 19:27:05', 'Software', '');
