INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(18, 'Grosses Display, kleiner Preis: HP Laptop bei ALDI aktuell zum Sparpreis ', , '<p>\r\nIm ALDI Onlineshop gibt es den HP Laptop 17-cp2537ng derzeit f√ºr 399 Euro. Ausgestattet mit einem Ryzen 3, 512 GB SSD und 8 GB RAM eignet sich das Ger√§t f√ºr allt√§gliche Aufgaben. Wie gut ist das Angebot wirklich? \r\n<br>\r\nWer ein Notebook mit gro√üem Display f√ºr Office- und Streaming-Anwendungen sucht, k√∂nnte mit dem‚ÄØHP 17-cp2537ng‚ÄØf√ºndig werden. Im ALDI Onlineshop kostet das Ger√§t aktuell nur 399 Euro. \r\n</p>\r\n<br>\r\n<h3>\r\nAlltagstaugliche Hardware zum kleinen Preis \r\n</h3>\r\n<br>\r\n<p>\r\nMit einem‚ÄØAMD Ryzen 3 7320U‚ÄØ(4 Kerne, 8 Threads, bis zu‚ÄØ4,1 GHz Boost) sowie‚ÄØ8 GB LPDDR5-RAM‚ÄØund einer schnellen‚ÄØ512 GB PCIe NVMe SSD‚ÄØbietet das Notebook solide Performance f√ºr Office und Multimedia. \r\n<br>\r\nTechnische Komponenten im √úberblick: \r\n<br>\r\nDisplay:‚ÄØ17,3\" (ca. 43,9 cm) Full HD (1.920 x 1.080), IPS, entspiegelt, 300 Nits, 45 % NTSC \r\n<br>\r\nProzessor:‚ÄØAMD Ryzen 3 7320U (bis 4,1 GHz, 4 Kerne, 8 Threads, 4 MB L3-Cache) \r\n<br>\r\nGrafik:‚ÄØIntegrierte AMD Radeon Grafikeinheit \r\n<br>\r\nArbeitsspeicher:‚ÄØ8 GB LPDDR5-5500 MT/s \r\n<br>\r\nSpeicher:‚ÄØ512 GB PCIe NVMe M.2 SSD \r\n<br>\r\nFarbe:‚ÄØNatural Silver \r\n<br>\r\nAbmessungen:‚ÄØCa. 40,07 x 25,78 x 1,99 cm \r\n</p>\r\n<br>\r\n<h3>\r\nWir meinen:\r\n</h3>\r\n<br>\r\n<p>\r\nF√ºr 399 Euro bietet der HP Laptop eine vern√ºnftige Ausstattung f√ºr Office, Streaming und allt√§gliche Anwendungen.‚ÄØDie Kombination aus Ryzen 3, schneller SSD und 8 GB RAM sorgt f√ºr fl√ºssiges Arbeiten, w√§hrend das gro√üe Display vor allem f√ºr Nutzer mit viel Platzbedarf von Vorteil ist. \r\n<br>\r\nEin Schwachpunkt ist die‚ÄØbegrenzte Farbraumabdeckung‚ÄØdes Displays, wodurch es sich weniger f√ºr professionelle Grafik- und Fotoarbeiten eignet. Zudem k√∂nnte die Leistung bei aufwendigen Anwendungen oder Gaming schnell an ihre Grenzen sto√üen, da nur eine integrierte Grafikeinheit vorhanden ist.\r\n</p>', 'Annika Schreiber', '2025-01-22 20:41:12', 'Hardware', 'must-read');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(20, 'GeForce RTX 5060 Laptop-Grafikakrten: GDDR7-Speicher und h√∂here Effizienz', , '<h3>\r\nNeue Einzelheiten zu NVIDIAs bevorstehenden GeForce RTX 5060 Laptop-Grafikkarten k√∂nnten bei Gamern auf gro√ües Interesse stossen. \r\n</h3>\r\n<br>\r\n<p>\r\nEnth√ºllungen √ºber die Grafikkarte aus der neuen ‚ÄûBlackwell‚Äú-Reihe wurden auf einem Event der Firma Shenzhen Hasee Computer Co. bekannt. Diese Firma ist als renommierter chinesischer Laptop-Produzent bekannt, was die Glaubw√ºrdigkeit der Informationen untermauert. \r\n</p>\r\n<br>\r\n<h3>\r\nGDDR7-Speicher f√ºr den Mainstream-Markt \r\n</h3>\r\n<br>\r\n<p>\r\nNach Aussage von Hasee Vorsitzendem Wu Haijun wird die NVIDIA GeForce RTX 50 ‚ÄûBlackwell‚Äú-Reihe die erste GPU sein, die √ºber‚ÄØGDDR7-Speicher‚ÄØverf√ºgt, sobald sie im n√§chsten Jahr erscheint. Man erwartet, dass diese Neuerung die Bandbreite bedeutend steigert und die VRAM-Kapazit√§ten m√∂glicherweise erweitert, was einen beachtlichen Fortschritt im Vergleich zu vorherigen Generationen bedeutet. \r\n</p>\r\n<br>\r\n<h3>\r\nMehr Leistung bei niedrigerem Energieverbrauch \r\n</h3>\r\n<br>\r\n<p>\r\nEin hervorstechendes Merkmal der anstehenden GeForce RTX 5060 ist ihre gestiegene Energieeffizienz. Die GPU soll deutlich weniger Energie ben√∂tigen als ihr Vorl√§ufermodell, die GeForce RTX 4060, und wird mit einer Maximalleistung von nur 115 Watt im Vergleich zu den 140 Watt der GeForce RTX 4060 auskommen. Diese Reduktion des Energiebedarfs stellt einen signifikanten Fortschritt dar, besonders f√ºr Spieler, die auf schlanken und leichten Gaming-Laptops maximale Leistung anstreben und profitiert dar√ºber hinaus auch die Akkulaufzeit. \r\n<br>\r\nTrotz des reduzierten Energieverbrauchs wird von der GeForce RTX 5060 eine hohe Leistungsf√§higkeit erwartet. Es wird berichtet, dass sie √§hnliche Spezifikationen wie die GeForce RTX 4070 Laptop-GPU aufweisen und besonders in Sachen Raytracing herausragen wird. Auch in Bezug auf Rasterisierungsleistung soll die GPU mit High-End-Chips konkurrieren oder diese sogar √ºbertreffen, was sie zu einem starken Mitbewerber im Markt f√ºr Gaming-Laptops macht. \r\n<br>\r\nAbgesehen von der Leistungsf√§higkeit bringt die GeForce RTX 50-Reihe auch technologische Neuerungen mit sich, wie etwa DLSS (Deep Learning Super Sampling) der n√§chsten Generation, was die grafische Darstellung und Bildrate beim Spielen weiter steigern soll. Zudem sind die Grafikprozessoren mit verbesserter Energieeffizienz versehen, die dazu beitr√§gt, den Gesamtenergieverbrauch des Systems zu verringern, w√§hrend sie gleichzeitig eine bessere Performance als die aktuelle ‚ÄûAda Lovelace‚Äú-Reihe bieten. \r\n<br>\r\nDie ‚ÄûX060‚Äú-Modelle von NVIDIA erfreuen sich bei Gamern gro√üer Beliebtheit. Exemplare wie die‚ÄØGeForce RTX 3060, die‚ÄØGeForce RTX 4060‚ÄØund die‚ÄØGeForce GTX 1060‚ÄØbefinden sich in der‚ÄØHardware-Umfrage von Steam‚ÄØkonstant an der Spitze der Nutzungsstatistiken, was ihre Popularit√§t im Mainstream- und Budget-Gaming-Bereich hervorhebt. Dies ist unter anderem auf ihre Preisgestaltung und Marktpr√§senz zur√ºckzuf√ºhren. Sollten die Berichte zutreffen, k√∂nnte die GeForce RTX 5060 zu einem weiteren Hauptbestandteil f√ºr Gaming-Laptops werden, das ein ausgewogenes Verh√§ltnis von Leistung und Effizienz bietet.\r\n<br>\r\n</p>\r\n<h3>\r\nGeForce RTX 50-Launch f√ºr Laptops im Jahr 2025 erwartet \r\n</h3>\r\n<br>\r\n<p>\r\nEs wird angenommen, dass NVIDIA die‚ÄØGeForce RTX 50 ‚ÄûBlackwell‚Äú-Grafikprozessoren‚ÄØauf der CES 2025 offiziell vorstellt und diese in der ersten H√§lfte des Jahres f√ºr Laptops verf√ºgbar macht. Diese Planung positioniert die GeForce RTX 5060 als ein signifikantes Upgrade im Vergleich zur aktuellen GeForce RTX 40-Serie und verspricht ein neues Level an Performance und Energieeffizienz f√ºr Gaming-Laptops. Je n√§her wir der Messe kommen, die Anfang Januar stattfindet, desto mehr Informationen werden erwartet. \r\n</p>', 'Felix Duarte', '2025-03-17 23:12:54', 'Hardware', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(22, 'Lenovo Laptop mit Snapdragon X Elite: Erste Werte in Benchmarks aufgetaucht', , '<h3>\r\nLenovo ist der n√§chste Hersteller, der die Snapdragon X Elite-CPU von Qualcomm in seine Produktlinie aufnimmt.\r\n</h3>\r\n<br>\r\n<p>\r\nEin neues Notebook mit der Modellnummer \"4810UV0100\" wurde auf Geekbench aufgelistet. Das Ger√§t ist mit der Snapdragon X Elite X1E78100 CPU ausgestattet und hat 12 Oryon-Kerne, die mit einem 4-nm-Prozess gefertigt sind. Die Benchmark-Tests zeigen einen Single-Core-Wert von 2.472 und einen Multicore-Wert von 14.254 auf einem System, das mit Windows 11 Pro und 32 GB RAM l√§uft. \r\n<br>\r\nDie Basisfrequenz der Snapdragon X Elite X1E78100 CPU auf Geekbench wird mit 3,42 GHz angegeben, die Turbo-Taktfrequenz wird in den Benchmark-Details nicht genannt. Der Prozessor dieses Lenovo Laptops scheint etwas niedrigere Spezifikationen zu haben als die leistungsst√§rkere Variante im Samsung Book4 Edge, das mit einem Basistakt von 4,0 GHz und einem Turbotakt von 4,3 GHz spezifiziert ist. Die Unterscheidung zwischen diesen Modellen deutet auf unterschiedliche Leistungsstufen innerhalb der Snapdragon X Elite-Serie von Qualcomm hin. \r\n<br>\r\nBislang umfasst die Snapdragon X Elite-Serie mehrere Modelle, wobei die Ger√§te von Lenovo und Samsung auf die High-End-CPUs der Serie verwenden. Es gibt auch Spekulationen √ºber eine Snapdragon X Plus-Serie, die m√∂glicherweise eine preisg√ºnstigere Variante mit weniger Kernen bietet, aber bisher sind noch keine solchen Ger√§te aufgetaucht. \r\n<br>\r\nQualcomm hat zwar noch keinen Termin f√ºr die Markteinf√ºhrung bekannt gegeben, aber man rechnet mit einer Ver√∂ffentlichung Mitte des Jahres, wenn Konkurrenten wie Intel und AMD auf Veranstaltungen wie der Computex neue Produkte vorstellen. Dieses Timing deutet darauf hin, dass Qualcomm schon bald weitere Details zu seiner Snapdragon X-Serie bekannt geben wird, die den Verbrauchern neue Optionen f√ºr Hochleistungscomputer bietet.\r\n</p>', 'Rhea Patel', '2025-03-05 08:12:19', 'Hardware', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(24, 'Neue Grafikkarten: Nvidia verschiebt kurz vor Launch', , '<h3>\r\nNvidias Mittelklasse-Grafikkarte GeForce RTX 5070 geht am 5. M√§rz in den Verkaufsstart. Eine beliebte FE-Variante ist aber weit und breit nicht zu sehen. \r\n</h3>\r\n<br>\r\n<p>\r\nIn den letzten Jahren hat sich Nvidia zu einem Vorreiter in Sachen Referenzdesign gemausert: Die eigenen Grafikkarten auf Basis neuer GPUs tragen den Namen \"Founders Edition\" oder \"FE\". Diese sind oft mit erstaunlich guten K√ºhlern versehen und setzen die Messlatte f√ºr die Preise der Custom-Varianten der Boardpartner. Zuletzt hat beispielsweise die RTX 5090 mit einem effektiven Blow-Through-K√ºhler f√ºr Aufsehen gesorgt. Hier pusten die L√ºfter nicht auf die Platine, sondern durch K√ºhlk√∂rper hindurch, was den Luftwiderstand verringert. \r\n<br>\r\nWer nun zum Launch der RTX 5070 auf eine FE hofft, wird erst einmal entt√§uscht sein: Zum Marktstart wird es keine geben. Das hat Nvidia verschiedenen Hardware-Redakteur*innen wenige Stunden vorm Embargofall der Reviews erz√§hlt. \r\n<br>\r\nEine FE soll es also weiterhin geben, aber erst gegen Ende des Monats. Fans m√ºssen sich also etwas gedulden ‚Äì aber nicht allzu lang. \r\n<br>\r\nDie Verschiebung gesellt sich zu einer ganzen Lade an Problemen mit der 5000er-Serie. Dazu z√§hlen hohe Temperaturen am 12VHPWR-Stromanschluss, teilweise fehlende ROP-Einheiten, √ºberh√∂hte Preise und schlechte Verf√ºgbarkeiten sowie eine eher konservative Leistungssteigerung im Vergleich zur Vorgeneration.\r\n</p> ', 'Elliot Vargas', '2025-03-17 23:26:42', 'Hardware', 'trending');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(26, 'Die besten Headsets im Test', , '<h3>\r\nGut verst√§ndlich in jedem Meeting \r\n</h3>\r\n<br>\r\n<p>\r\nDer erste Eindruck z√§hlt. Vor allem, wenn dieser √ºber das Telefon vermittelt werden soll. Aus diesem Grund ist es gerade in der heutigen Gesch√§ftswelt umso wichtiger mit klarer, gut verst√§ndlicher Stimme zu kommunizieren. Damit dies gelingt, ist ein gutes Headset mit Mikrofon von gro√üer Bedeutung. Wir von CHIP haben deswegen 20 verschiedene Headsets, sowohl wireless als auch kabelgebunden, eingehend getestet und unsere Empfehlungen f√ºr Sie detailliert zusammengefasst. \r\n<br>\r\nDas lesen Sie in diesem Beitrag:‚ÄØGleich zu Beginn pr√§sentieren wir Ihnen vier Empfehlungen der Tester. Darunter finden Sie auch den Testsieger und Preistipp. Im Anschluss daran erfahren Sie, was ein gutes Headset kosten darf, wie die Testergebnisse entstanden sind, in welchen Situationen Headsets sinnvoll sind und was es f√ºr verschiedene Bauformen gibt. Diese umfangreiche Analyse soll Ihnen bei der Auswahl eines geeigneten Headsets behilflich sein. \r\n</p>\r\n<br>\r\n<h3>\r\nTestsieger: JBL Quantum 800\r\n</h3>\r\n<br>\r\n<p>\r\nBeim JBL Quantum 800 handelt es sich um ein kabelloses Gaming-Headset mit beleuchtetem Firmenlogo auf den Ohrmuscheln. Die Beleuchtung l√§sst sich vollst√§ndig abschalten. So kann die kurze Akkulaufzeit von rund 9 Stunden nahezu verdoppelt werden und das JBL Quantum 800 ist auch f√ºr den normalen Office-Alltag verwendbar. \r\n<br>\r\nBesonders der Sound √ºberzeugt w√§hrend des Tests, sowohl bei der Wiedergabe als auch bei der Aufnahme.‚ÄØSelbst leise Stimmen oder Fl√ºstern sind deutlich √ºber das hochklappbare (und dadurch stumm zu schaltende) Mikrofon und die drahtlose Verbindung zu verstehen. St√∂rger√§usche von au√üen werden f√ºr Tragende durch eine aktive Ger√§uschunterdr√ºckung der Kopfh√∂rer, Active Noise Cancelling, sehr gut herausgefiltert. So st√∂rt auch der laute Verkehrsl√§rm nicht mehr beim Test. Selbst der Gespr√§chspartner h√∂rt au√üer den leisen Tippger√§uschen der Tastatur kein st√∂rendes Hintergrundrauschen des Mikrofons. Lediglich im h√∂heren Frequenzbereich hat es den Anschein als klingen Aufnahmen leicht abgehackt.\r\n</p>', 'Amelie Fankhauser', '2025-03-09 17:20:10', 'Hardware', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(28, 'iRobot r√ºstet auf: Neue Roomba-Modelle mit Lidar und automatischer Mopp-Reinigung', , '<p>\r\nGleich acht neue Modelle hat iRobot angek√ºndigt ‚Äì erstmals wird ein Lidar-Scanner f√ºr die Navigation eingesetzt. Nach einem turbulenten Jahr 2024 will der Saugroboter-Pionier damit wieder Fuss fassen. \r\n<br>\r\nDer Gr√ºnder und CEO musste zur√ºcktreten, die‚ÄØFusion mit Amazonscheiterte, das US-Unternehmen schlitterte tief in die roten Zahlen und musste Mitarbeitende entlassen ‚Äì 2024 war ein schwieriges Jahr f√ºr iRobot. Schlimmer noch: Der einstige Pionier bei den Haushaltsrobotern konnte bei Technik und Features nicht mehr mit der Konkurrenz mithalten. Auch bei meinem grossen‚ÄØSaugroboter-Vergleich‚ÄØlandete das iRobot-Modell auf dem letzten Platz. \r\n<br>\r\nDas soll nun alles anders werden. Gleich acht neue Modelle hat der Hersteller angek√ºndigt, f√ºnf davon kommen auch zu uns in den Shop. iRobot n√§hert sich dabei konzeptuell der chinesischen Konkurrenz von Roborock, Dreame oder Ecovacs an: Die Roboter navigieren nicht mehr nur mit der Kamera, sondern auch mit Lidar-Scannern. Runde Mopps wischen feucht, die Basisstation reinigt die Mopps automatisch. \r\n<br>\r\nSchauen wir uns die Modelle im Detail an, die auch bei uns lanciert werden.\r\n</p>\r\n<br>\r\n<h3>\r\nRunde Mopps, automatisch gewaschen \r\n</h3>\r\n<br>\r\n<p>\r\nRoomba Plus 405 Combo Robot mit AutoWash Dock:‚ÄØDas neue Modell ist f√ºr eine unverbindliche Preisempfehlung von 600 Franken oder 700 Euro erh√§ltlich und bietet viele Features, die erstmals bei iRobot zum Einsatz kommen. Neben dem Lidar-Scanner sind das runde Wischmopps, die auch gleich in der Absaugstation gewaschen und getrocknet werden. Wie alle anderen Modelle ist der 405 mit den Sprachassistenten von Apple, Amazon und Google kompatibel. Ab dem 1. April ist der Saugroboter voraussichtlich bei uns im Shop erh√§ltlich. \r\n</p>\r\n<br>\r\n<img src=\"../assets/embed/Image (18).jpeg\">\r\n<br>\r\n<p>\r\nRoomba Plus 505 Combo Robot mit AutoWash Dock:‚ÄØDas Topmodell der neuen Produktpalette kostet 700 Franken oder 800 Euro. Die Unterschiede zum 405: Der 505 kann einen der zwei runden Mopps zur Seite ausfahren, um die Ecken zu putzen. Zudem trocknet die Basisstation die Mopps nach dem Waschen mit heisser Luft. Das System erkennt dank k√ºnstlicher Intelligenz verschiedene Verschmutzungen und Hindernisse und kann ihnen daher besser ausweichen oder bei Bedarf intensiver putzen. Der Roomba 505 ist ab 18. M√§rz bestellbar. \r\n</p>\r\n<br>\r\n<h3>\r\nAuch Einsteiger-Ger√§te mit Lidar\r\n</h3>\r\n<br>\r\n<p>\r\nRoomba 105:‚ÄØDas g√ºnstige Modell kostet 300 Euro oder 250 Franken (UVP) und hat, wie die teureren Ger√§te, ein System mit Kamera und Lidar inklusive Hinderniserkennung. Eine Basisstation mit Absaugfunktion fehlt hier, du musst also den Staubbeh√§lter von Hand leeren. Zum Wischen verwendet der Roboter ein Mikrofasertuch, das automatisch befeuchtet wird. Der Roomba 105 ist ab dem 18. M√§rz bestellbar. \r\n<br>\r\nRoomba 105 mit Absaugstation:‚ÄØDas Einsteigermodell ist auch in einer Variante mit Absaugstation erh√§ltlich. Staub und Dreck werden dort in einen Beutel verfrachtet, wobei 99 Prozent aller Partikel bis 0,7 Mikrometer einbehalten werden sollen. Der ebenfalls ab dem 18. M√§rz bestellbare Roomba 105 mit Absaugstation kostet 350 Franken oder 400 Euro. \r\n<br>\r\nRoomba 205 DustCompactor Combo:‚ÄØEine Absaugstation bietet die Mittelklasse f√ºr 350 Franken oder 450 Euro zwar nicht, daf√ºr eine andere Innovation. Der Roboter komprimiert den aufgesaugten Schmutz laufend, sodass du den Staubbeh√§lter erst nach rund 60 Tagen leeren musst. Sonst ist das Modell dem Roomba 105 sehr √§hnlich ‚Äì und ebenfalls ab dem 18. M√§rz erh√§ltlich. \r\n</p>', 'Jonas Brecht', '2025-02-18 12:45:55', 'Hardware', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(30, 'Powerbanks und Brandgefahr: Einige Airlines f√ºhren neue Regelungen ein ', , '<h3>\r\nMehrere asiatische Airlines f√ºhren strengere Regeln f√ºr den Transport und die Nutzung von Powerbanks in ihren Flugzeugen ein. Grund ist deren Brand- und Explosionsgefahr bei falscher Lagerung oder Nutzung. \r\n</h3>\r\n<br>\r\n<p>\r\nPowerbanks sind eine beliebte M√∂glichkeit, um unterwegs die Nutzungsdauer von Smartphones, Kopfh√∂rern und Co. zu verl√§ngern. Deswegen befinden sie sich gerade auf Reisen h√§ufig im Gep√§ck. Durch mechanische Besch√§digungen, starke Druckbelastung, unsachgem√§√üe Nutzung oder zu hohe Temperaturen kann es jedoch zu Kurzschl√ºssen und Br√§nden oder sogar Explosionen kommen. Deswegen gelten Powerbanks als Gefahrgut an Bord von Flugzeugen und unterliegen speziellen Vorschriften. \r\n<br>\r\nEinige asiatische Fluglinien haben k√ºrzlich ihre bestehenden Restriktionen bez√ºglich Powerbanks weiter versch√§rft. Grund ist ein‚ÄØZwischenfall in S√ºdkorea: In einer Passagiermaschine brach im Januar in der Kabine ein Brand aus. \r\n<br>\r\nUrsache ist m√∂glicherweise eine gequetschte Powerbank im Gep√§ckfach √ºber den Sitzen ‚Äì die Brandursache ist aber noch nicht vollst√§ndig gekl√§rt. Da der Brand noch vor dem Start aufgefallen war, konnten die Insassen rechtzeitig evakuiert werden. Der Flugzeugrumpf brannte zu gro√üen Teilen aus. \r\n<br>\r\n</p>\r\n<h3>\r\nWelche Beschr√§nkungen gelten bisher f√ºr Powerbanks in Flugzeugen? \r\n</h3>\r\n<br>\r\n<p>\r\nViele Fluggesellschaften halten sich bez√ºglich der Sicherheitsvorgaben an die Empfehlungen der International Air Transport Association (IATA). Das ist eine Organisation, die globale Standards und Richtlinien f√ºr den Flugverkehr entwickelt. \r\n<br>\r\nDemnach darfst du seit 2016 Powerbanks und andere Ger√§te mit Lithium-Ionen-Akkus wie Laptops und Tablets nur im Handgep√§ck mitf√ºhren. Sollte es im Gep√§ckabteil des Flugzeugs zu einem Brand kommen, w√ºrde er zu sp√§t entdeckt werden. \r\n<br>\r\nAu√üerdem erlauben Airlines nur Powerbanks mit einer maximalen Kapazit√§t von 100 Wh. Powerbanks f√ºr Laptops √ºberschreiten diese Grenze h√§ufig. Bei mehr als 100 Wh musst du zuvor die Airline um Erlaubnis fragen und laut IATA d√ºrfen auch bei positivem Bescheid‚ÄØmaximal zwei solcher Powerbanks‚ÄØmitgef√ºhrt werden.\r\n<br>\r\n</p>\r\n<h3>\r\nMehrere Airlines erlassen unterschiedliche Regelungen\r\n</h3>\r\n<br>\r\n<p>\r\nAufgrund des Zwischenfalls in S√ºdkorea haben mehrere Fluggesellschaften aus Asien ihre Regelungen versch√§rft, wie die‚ÄØNew York Times berichtet. Das betrifft auch dich, wenn du mit diesen Fluglinien fliegst. \r\n<br>\r\nDie s√ºdkoreanische Regierung‚ÄØwies alle Airlines des Landes‚ÄØan, die Versch√§rfungen umzusetzen. Sie gelten seit dem ersten M√§rz 2025. Demnach d√ºrfen nun maximal f√ºnf Powerbanks unter 100 Wh pro Person an Bord, nat√ºrlich nur im Handgep√§ck. Au√üerdem darfst du sie nicht im Gep√§ckfach √ºber dir lagern, sondern du musst sie griffbereit bei dir behalten, um schnell reagieren zu k√∂nnen. Auff√§lligkeiten wie Rauchentwicklung und √úberhitzung sind sofort dem Bordpersonal zu melden. \r\n<br>\r\nDu darfst deine Powerbank w√§hrend des Fluges nicht aufladen (zum Beispiel durch den Lade-Slot im Flugzeug oder mit einer anderen Powerbank). Zudem solltest du Powerbanks einzeln in Beuteln lagern oder die Anschl√ºsse abkleben, damit kein Metall an die Kontakte gelangen kann. \r\n<br>\r\nDas Ministerium gibt an, dass gegebenenfalls weitere Versch√§rfungen kommen, wenn sich herausstellt, dass der Brand im Januar durch eine Powerbank verursacht wurde. Gem√§√ü der NYT haben manche taiwanesische Airlines diese Regelungen ebenfalls implementiert. \r\n<br>\r\nEVA Air und China Airlines k√ºndigten an, die Nutzung von Powerbanks in ihren Fl√ºgen zu verbieten, erlauben aber weiterhin die Aufbewahrung im Gep√§ckfach. Thai Airways‚ÄØverbietet ab dem 15. M√§rz‚ÄØebenfalls die Nutzung von Powerbanks. Singapore Airlines und deren Tochterfirma Scoot‚ÄØverbieten‚ÄØdie Nutzung und das Laden von Powerbanks ab dem 1. April. \r\n<br>\r\nAuch andere Fluggesellschaften k√∂nnten kurzfristig neue Vorgaben einf√ºhren. Du solltest vor deinem Flug daher am besten auf der Website deiner Airline nachschauen, welche Regelungen f√ºr deinen Flug gelten. \r\n</p>', 'Saskia Hofer', '2025-03-07 16:16:16', 'Hardware', '');
INSERT INTO `articles` (`article_id`, `article_title`, `article_cover`, `article_content`, `article_author`, `article_date`, `article_category`, `article_tag`) VALUES
(32, 'Beliebtes Bildbearbeitungs-Programm mit dritter Version zur√ºck', , '<h3>\r\nGIMP 3.0 ist da ‚Äì mit neuer Oberfl√§che, nicht destruktiven Effekten und Profi-Farbr√§umen. COMPUTER BILD hat alle Infos zur neuen Version.\r\n</h3>\r\n<br>\r\n<p>\r\nDie digitale Bildbearbeitung ist seit jeher untrennbar mit einem Namen verbunden: Adobe Photoshop. √úber Jahrzehnte hat sich die professionelle Software zum unumstrittenen Industriestandard entwickelt. Einziger Nachteil: Photoshop ist kostenpflichtig und damit nicht f√ºr jeden erschwinglich. Wer bislang nach einer hochwertigen, kostenlosen Alternative suchte, stie√ü unweigerlich auf das GNU Image Manipulation Program ‚Äì kurz GIMP. Doch auch hier gab es zuletzt ein deutliches Manko: Die aktuellste Version des beliebten Open-Source-Programms erschien im Februar 2023 und wirkte zunehmend in die Jahre gekommen. Doch damit ist jetzt Schluss: Nach sieben Jahren intensiver Entwicklungsarbeit steht endlich GIMP 3.0 bereit ‚Äì und bringt eine Vielzahl neue Funktionen und Verbesserungen mit sich.\r\n</p>\r\n<br>\r\n<h3>\r\nNeue Benutzeroberfl√§che verbessert Darstellung\r\n</h3>\r\n<br>\r\n<p>\r\nDie auff√§lligste Neuerung ist die Umstellung auf die moderne GTK3-Benutzeroberfl√§che. Diese erm√∂glicht eine deutlich bessere Darstellung auf hochaufl√∂senden Bildschirmen und optimiert die Unterst√ºtzung von Tablets. Die Benutzeroberfl√§che wurde durch einen optionalen Willkommensdialog erg√§nzt, der das schnelle Erstellen von neuen Projekten erm√∂glichen soll. Die neue Version bietet dar√ºber hinaus sogenannte nicht destruktive Ebeneneffekte. Die bleiben, anders als in Vorg√§ngerversionen, in GIMP 3.0 aktiv und lassen sich jederzeit nachtr√§glich bearbeiten. Dies sorgt nicht nur f√ºr deutlich mehr Flexibilit√§t beim Bearbeiten komplexer Projekte, sondern auch f√ºr effizientere Arbeitsabl√§ufe. Schlie√ülich lassen sich Effekte beliebig anpassen, deaktivieren oder l√∂schen, ohne den urspr√ºnglichen Zustand der Ebene zu beeintr√§chtigen.\r\n</p>\r\n<br>\r\n<h3>\r\nGrundlage f√ºr CMYK- und LAB-Farbmodi\r\n</h3>\r\n<br>\r\n<p>\r\nEine weitere tiefgreifende Verbesserung von GIMP 3.0 betrifft die Integration mit den Babl- und GEGL-Bibliotheken. Dank der optimierten Zusammenarbeit dieser Kernkomponenten unterst√ºtzt das Programm nun umfassender RGB-Farbr√§ume jenseits von sRGB. Diese wichtige Neuerung bildet auch die technische Grundlage f√ºr eine k√ºnftige Integration von CMYK- und LAB-Farbmodi, die insbesondere im professionellen Bereich unverzichtbar sind. Durch diese Weiterentwicklung positioniert sich GIMP noch st√§rker als professionelle und ernst zu nehmende Alternative zu kostenpflichtigen L√∂sungen.\r\n</p>\r\n<br>\r\n<h3>\r\nGIMP 3.0 ab sofort verf√ºgbar\r\n</h3>\r\n<br>\r\n<p>\r\nAbseits dessen wurde in GIMP 3.0 die Verwaltung von Ebenen deutlich vereinfacht. So unterst√ºtzt das Programm nun erstmals die Mehrfachauswahl von Ebenen, was die Arbeit mit komplexen Projekten sp√ºrbar beschleunigt. Und es steht eine leistungsf√§hige Suchfunktion bereit, mit der sich einzelne Ebenen gezielt und schneller finden lassen. Ebenfalls neu: Es werden nun Formate wie ICNS, CUR, ANI, QOI und JPEG XL unterst√ºtzt. Das knapp 370 Megabyte gro√üe GIMP 3.0 steht ab sofort sowohl f√ºr Windows, macOS als auch Linux zur Verf√ºgung.\r\n</p>', 'Topgu Yvril', '2025-03-11 10:25:30', 'Software', 'trending');

